import axios from 'axios'
import React from 'react'

function ShowData(props) {
    axios('https://countryflagsapi.com/png/br')
          .then((response)=>{
              console.log(response);
          })
  return (
    <>
        <tbody>
        <tr>
            <td>{props.id+1}</td>
            <td>{props.list.city}</td>
            <td>{props.list.country}</td>
        </tr>
        </tbody>
        
        
    </>
  )
}

export default ShowData
